// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AudioExchange {
    struct Audio {
        address owner;
        string title;
        string artist;
        string ipfsHash;
        uint256 price;
        bool isForSale;
    }

    Audio[] public audios;
    mapping(uint256 => address) public audioToOwner;

    event AudioUploaded(uint256 id, address owner, string ipfsHash);
    event AudioPurchased(uint256 id, address buyer, address seller, uint256 price);

    function uploadAudio(
        string memory _title,
        string memory _artist,
        string memory _ipfsHash,
        uint256 _price
    ) public {
        uint256 id = audios.length;
        audios.push(Audio(msg.sender, _title, _artist, _ipfsHash, _price, true));
        audioToOwner[id] = msg.sender;
        emit AudioUploaded(id, msg.sender, _ipfsHash);
    }

    function purchaseAudio(uint256 _id) public payable {
        require(_id < audios.length, "Audio does not exist");
        require(audios[_id].isForSale, "Audio is not for sale");
        require(msg.value >= audios[_id].price, "Insufficient ETH");

        address seller = audioToOwner[_id];
        audioToOwner[_id] = msg.sender;
        audios[_id].owner = msg.sender;
        audios[_id].isForSale = false;

        (bool sent, ) = seller.call{value: msg.value}("");
        require(sent, "Payment failed");
        emit AudioPurchased(_id, msg.sender, seller, msg.value);
    }

    function getAudioCount() public view returns (uint256) {
        return audios.length;
    }
}

